stdout:
type :slice = { l 2 }

function $main_thingy() {
@start
@b0
    %l0 =w copy 42
    call $print_int(w %l0, )
    %l2 =w copy 69
    call $print_int(w %l2, )
    %l4 =w copy 420
    call $print_int(w %l4, )
    ret
}
export function w $main() {
@start
@b0
    %l0 =l copy 256
    %l1 =l call $malloc(l %l0, )
    %l2 =w copy 0
    call $print_int(w %l2, )
    call $main_thingy()
    %l5 =w copy 0
    %l6 =w copy 1
    call $print_int(w %l6, )
    %l8 =w copy 2
    call $print_int(w %l8, )
    call $free(l %l1, )
    ret %l5
}
